Szuka nowego Właściciela !!!



Kia Rio z 2010 r. (ostatni rok drugiej wersji) z maksymalnym jak na tamte czasy wyposażeniem.

Pierwsza rejestracja: styczeń 2011.

Mamy zatem:

-  sprawną klimatyzację, a w sumie to półklimatronik;

-  instalację LPG (butla w kole ważna do 2028, wlew pod klapką)

-  cały zestaw poduszek powietrznych;

-  kontrolę trakcji;

-  ABS;

-  radioodtwarzacz  z odczytem PM3; 

-  złącze USB i AUX;

-  wielofunkcyjną kierownicę z pokrowcem;

-  pełną elektrykę sterowania szyb i lusterek;

-  kierunki w lusterkach;

-  halogeny, uchwyt na telefon;

-  drugi zestaw felg stalowych z zimówkami Pirelli Cinturato 15" w super stanie + 4 oryginalne kołpaki .



Jestem właścicielem Kijanki od 4 lat i od przebiegu 120 tys. km, a zatem wiem sporo na jego temat. Za moich czasów nie uczestniczyło w żadnym, poważnym incydencie, choć zdarzyło się zatrzymanie na haku auta poprzedzającego, co zostawiło skazę na zderzaku i honorze.

Na kołach są letnie Continentale w bardzo dobrym stanie, a alu też prezentują się całkiem niegłupio. 

Samochód na bieżąco serwisowany, nie wymaga interwencji. Z tego co zauważyłem, zaczęła "podciekać" osłona na lewym, przednim przegubie. Auto nie plami, jest szczelne.

Proszę też pamiętać, że auto ma 15 lat, jest trochę rysek, odprysków od kamyków, a na tylnych nadkolach pojawiły się początki "rudej". Wnętrze auta prezentuje się rewelacyjnie jak na swój wiek i przebieg.

Jestem przekonany, że zarówno cena jak i wyposażenie mocno zrekompensują wspomniane niedogodności. 

Zapraszam do obejrzenia, na testy i ewentualnego zakupu. 

Jeśli komuś nie przypadnie do gustu Kijanka, to może spodoba mu się o 2 lata młodszy Peugeot 206 plus, który jest wystawiony na innym ogłoszeniu. Ma silnik 1.4 B i również nadaje się pod LPG.

Witam.



Sprzedam Chryslera Town Country z 2007 roku. Silnik 3,8 benzyna + gaz.

Silnik pracuje równo, nie bierze oleju, auto dobrze się prowadzi, niedawno wymienione hamulce przód i tył.

Auto jest dość dobrze wyposażone:

- klimatyzacja;

- skórzana tapicerka;

- elektrycznie otwierane drzwi boczne i klapa tylna;

- elektrycznie otwierane szyby z przodu, w drugim rzędzie i w trzecim rzędzie (uchylane);

- elektrycznie sterowane i podgrzewane lusterka;

- podgrzewane siedzenia przednie i w drugim rzędzie;

- elektryczna regulacja odległości pedałów;

- odtwarzacz z 3 ekranami (nigdy nie korzystałem);

-  stopnie (progi zewnętrzne);

- 17 calowe koła;

- hak;

- duża butla gazowa w bagażniku;

Auto do drobnej naprawy blacharskiej/lakierniczej. Niedawno wystąpił błąd czujnika prędkości w skrzyni biegów (po kilku kilometrach, skrzynia włącza tryb awaryjny - auto jedzie na 2 biegu oraz na wstecznym). Autem można się więc poruszać na niewielkie odległości. Z tego powodu samochód sprzedaję jako uszkodzony.

Po więcej informacji proszę o kontakt pod numerem 6.0.0x2x7x2x7-9-8
